import React from 'react';

import { Note } from '../../styles/02_tools/styled_component/components/fonts';

import resume from '../../files/resume_01.29.20.pdf';

// import lightTheme from '../../styles/02_tools/styled_component/lightTheme';

function Footer() {
  return (
    <div className="footer-container">
      <div className="footer">
        <Note className="copyright">
          Copyright Â© 2020 Noah Jung. <br />
          All rights reserved. <br />
          Developed using React.
        </Note>
        <div className="links">
          <a href="mailto:noahsjung@gmail.com">
            <Note className="email">Email</Note>
          </a>
          <a href={resume} target="blank">
            <Note className="resume">Resume</Note>
          </a>
          <a href="https://www.linkedin.com/in/noahsjung/" target="blank">
            <Note className="linkedin">LinkedIn</Note>
          </a>
        </div>
      </div>
    </div>
  );
}

export default Footer;
